class Privacy extends React.Component {
    render() {
        return (
            <div>
                <h1>Privacy Policy</h1>
                <ol>
                    <li><a href="#cookies">Cookies</a></li>
                    <li><a href="#ga">Google Analytics</a></li>
                </ol>
                <h1>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewjgaiowjawe<br></br>aoweijaoewijgaioewj